// add returns x+y.
func add(x, y V) V {
	switch x := x.(type) {
	case F:
		return addFV(x, y)
	case I:
		return addIV(x, y)
	case S:
		return addSV(x, y)
	case AB:
		return addABV(x, y)
	case AF:
		return addAFV(x, y)
	case AI:
		return addAIV(x, y)
	case AS:
		return addASV(x, y)
	case AV:
		switch y := y.(type) {
		case array:
			if y.Len() != len(x) {
				return errf("x+y : length mismatch: %d vs %d", len(x), y.Len())
			}
			r := make(AV, len(x))
			for i := range r {
				v := add(x[i], y.At(i))
				e, ok := v.(errV)
				if ok {
					return e
				}
				r[i] = v
			}
			return r
		}
		r := make(AV, len(x))
		for i := range r {
			v := add(x[i], y)
			e, ok := v.(errV)
			if ok {
				return e
			}
			r[i] = v
		}
		return r
	default:
		return errType("x+y", "x", x)
	}
}

