// multiply returns x*y.
func multiply(x, y V) V {
	switch x := x.(type) {
	case F:
		return multiplyFV(x, y)
	case I:
		return multiplyIV(x, y)
	case S:
		return multiplySV(x, y)
	case AB:
		return multiplyABV(x, y)
	case AF:
		return multiplyAFV(x, y)
	case AI:
		return multiplyAIV(x, y)
	case AS:
		return multiplyASV(x, y)
	case AV:
		switch y := y.(type) {
		case array:
			if y.Len() != len(x) {
				return errf("x*y : length mismatch: %d vs %d", len(x), y.Len())
			}
			r := make(AV, len(x))
			for i := range r {
				v := multiply(x[i], y.At(i))
				e, ok := v.(errV)
				if ok {
					return e
				}
				r[i] = v
			}
			return r
		}
		r := make(AV, len(x))
		for i := range r {
			v := multiply(x[i], y)
			e, ok := v.(errV)
			if ok {
				return e
			}
			r[i] = v
		}
		return r
	default:
		return errType("x*y", "x", x)
	}
}

