// modulus returns x mod y.
func modulus(x, y V) V {
	switch x := x.(type) {
	case F:
		return modulusFV(x, y)
	case I:
		return modulusIV(x, y)
	case AB:
		return modulusABV(x, y)
	case AF:
		return modulusAFV(x, y)
	case AI:
		return modulusAIV(x, y)
	case AV:
		switch y := y.(type) {
		case array:
			if y.Len() != len(x) {
				return errf("x mod y : length mismatch: %d vs %d", len(x), y.Len())
			}
			r := make(AV, len(x))
			for i := range r {
				v := modulus(x[i], y.At(i))
				e, ok := v.(errV)
				if ok {
					return e
				}
				r[i] = v
			}
			return r
		}
		r := make(AV, len(x))
		for i := range r {
			v := modulus(x[i], y)
			e, ok := v.(errV)
			if ok {
				return e
			}
			r[i] = v
		}
		return r
	default:
		return errType("x mod y", "x", x)
	}
}

